import {Link, useNavigate} from 'react-router-dom'

function Login({setUser}){

    function handleSubmit(e){
        e.preventDefault()
        setUser(e.target.username.value)
    }

    return(
        <div>
            <form onSubmit={(e)=> handleSubmit(e)}>
                <input name="username"/>
            </form>
        </div>
    )
}
export default Login
